export const onLoadRouteAction = (routes) => dispatch => {
    dispatch({
        type: 'ONLOAD_ROUTE_ACTION',
        payload: routes,
    })
}

export const directionAction = (directionDate) => dispatch => {
    dispatch({
        type: 'DIRECTION_ACTION',
        payload: directionDate,
    })
}
